export default function handler(req, res) {
  const { method } = req;

  if (method === 'GET') {
    db.all('SELECT * FROM todos', (err, rows) => {
      if (err) {
        res.status(500).json({ error: err.message });
      } else {
        res.status(200).json(rows);
      }
    });
  } else if (method === 'POST') {
    const { nr, name, beschreibung, status } = req.body;
    db.run(
      'INSERT INTO todos (nr, name, beschreibung, status) VALUES (?, ?, ?, ?)',
      [nr, name, beschreibung, status],
