      'UPDATE todos SET name = ?, beschreibung = ?, status = ? WHERE id = ?',
      [updates.name, updates.beschreibung, updates.status, id],
      function (err) {
        if (err) {
          res.status(500).json({ error: err.message });
        } else {
          res.status(200).json({ changes: this.changes });
        }
