import { useState, useEffect } from 'react';

export default function TodoList() {
  const [todos, setTodos] = useState([]);
  const [newTodo, setNewTodo] = useState({ nr: '', name: '', beschreibung: '', status: 'offen' });

  useEffect(() => {
    fetch('/api/todos')
      .then(res => res.json())
      .then(data => setTodos(data));
  }, []);

  const handleAddTodo = async () => {
    const response = await fetch('/api/todos', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newTodo),
    });
    const data = await response.json();
    setTodos([...todos, { ...newTodo, id: data.id }]);
    setNewTodo({ nr: '', name: '', beschreibung: '', status: 'offen' });
  };

  const handleUpdateTodo = async (id, updates) => {
    await fetch(`/api/todos/${id}`, {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(updates),
    });
    setTodos(todos.map(todo => (todo.id === id ? { ...todo, ...updates } : todo)));
  };

  const handleDeleteTodo = async (id) => {
    await fetch(`/api/todos/${id}`, { method: 'DELETE' });
    setTodos(todos.filter(todo => todo.id !== id));
  };

  return (
    <div className="max-w-2xl mx-auto p-4 bg-white rounded-xl shadow-md glassmorphism">
      <h1 className="text-2xl font-bold mb-4 text-gray-800">Todo-Liste</h1>
      <form onSubmit={handleAddTodo}>
        <input
          type="number"
          value={newTodo.nr}
          onChange={(e) => setNewTodo({ ...newTodo, nr: e.target.value })}
          placeholder="Nummer"
          className="w-full p-3 mb-4 border border-gray-400 rounded-lg focus:outline-none bg-white/90 backdrop-blur-md"
        />
        <input
          type="text"
          value={newTodo.name}
          onChange={(e) => setNewTodo({ ...newTodo, name: e.target.value })}
          placeholder="Name"
          className="w-full p-3 mb-4 border border-gray-400 rounded-lg focus:outline-none bg-white/90 backdrop-blur-md"
        />
        <textarea
          value={newTodo.beschreibung}
          onChange={(e) => setNewTodo({ ...newTodo, beschreibung: e.target.value })}
          placeholder="Beschreibung"
          className="w-full p-3 mb-4 border border-gray-400 rounded-lg focus:outline-none bg-white/90 backdrop-blur-md"
        />
        <select
          value={newTodo.status}
          onChange={(e) => setNewTodo({ ...newTodo, status: e.target.value })}
          className="w-full p-3 mb-4 border border-gray-400 rounded-lg focus:outline-none bg-white/90 backdrop-blur-md"
        >
          <option value="offen">Offen<<LOCAL_PATH>          <option value="in Arbeit">In Arbeit<<LOCAL_PATH>          <option value="erledigt">Erledigt<<LOCAL_PATH>        </select>
        <button
          type="submit"
          className="w-full p-3 mb-6 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors glassmorphism"
        >
          Hinzufügen
        </button>
      </form>
      <ul className="mb-6">
        {todos.map((todo) => (
          <li key={todo.id} className="mb-4 bg-white/70 rounded-xl p-4 shadow-sm glassmorphism">
            <div className="flex justify-between items-start">
              <div>
                <h2 className="text-lg font-medium text-gray-800">{todo.name}</h2>
                <p className="text-sm text-gray-600 mt-1">{todo.beschreibung}</p>
              </div>
              <div className="flex items-center space-x-2">
                <span className={`px-2 py-1 rounded-full text-xs font-medium ${
                  todo.status === 'offen' ? 'bg-green-100 text-green-800' : 
                  todo.status === 'in Arbeit' ? 'bg-yellow-100 text-yellow-800' : 
                  'bg-red-100 text-red-800'
                }`}>
                  {todo.status}
                </span>
                <button
                  onClick={() => handleUpdateTodo(todo.id, { status: 'in Arbeit' })}
                  className="px-3 py-1 rounded-full text-xs font-medium bg-yellow-500 text-white hover:bg-yellow-600 glassmorphism"
                >
                  In Arbeit
                </button>
                <button
                  onClick={() => handleUpdateTodo(todo.id, { status: 'erledigt' })}
                  className="px-3 py-1 rounded-full text-xs font-medium bg-green-500 text-white hover:bg-green-600 glassmorphism"
                >
                  Erledigt
                </button>
                <button
                  onClick={() => handleDeleteTodo(todo.id)}
                  className="px-3 py-1 rounded-full text-xs font-medium bg-red-500 text-white hover:bg-red-600 glassmorphism"
                >
                  Löschen
                </button>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

